// In src/pages/BookTutor.js
import React from 'react';
import { Layout, Form, Input, Button } from 'antd';
const { Content } = Layout;

const BookTutor = () => {
  // Handler for form submission
  const onFinish = (values) => {
    console.log('Received values of form: ', values);
  };

  return (
    <Layout style={{ minHeight: '100vh' }}> {/* This ensures the layout takes up full page height */}
      <Content style={{ padding: '50px', overflow: 'auto' }}> {/* Allows for scrolling */}
        <div style={{ background: '#fff', padding: 24, minHeight: 280, borderRadius: '8px' }}>
          <h1 style={{ textAlign: 'center' }}>Book a Tutor</h1>
          <Form layout="vertical" onFinish={onFinish}>
            <Form.Item label="Name" name="name" rules={[{ required: true, message: 'Please input your name!' }]}>
              <Input />
            </Form.Item>
            <Form.Item label="Email" name="email" rules={[{ required: true, message: 'Please input your email!' }]}>
              <Input type="email" />
            </Form.Item>
            <Form.Item label="Subject" name="subject" rules={[{ required: true, message: 'Please input the subject!' }]}>
              <Input />
            </Form.Item>
            <Form.Item label="Address" name="address" rules={[{ required: true, message: 'Please input your address!' }]}>
              <Input />
            </Form.Item>
            <Form.Item>
              <Button type="primary" htmlType="submit">
                Submit
              </Button>
            </Form.Item>
          </Form>
        </div>
      </Content>
    </Layout>
  );
};

export default BookTutor;
